import React from 'react';
import './CompanyLogin.css';

function CompanyLogin() {
    return (
        <div className='cl'>
            <form>
            Username <input type='text'/> <br></br>
            Password  <input type='password'/> <br></br>
            <button variant="primary">Primary</button>
            </form>
        </div>
    )
}

export default CompanyLogin
